import React from 'react';
import {FilterValuesType} from "./App";
import s from './Button.module.css'



type ButtonType = {
    name:string
    started:()=>void
    filtered?:(nameButton:FilterValuesType)=>void
}


export const Button = (props:ButtonType) => {

    const  Started=()=> {
        props.started()
    }
    return (

            <button className={props.filtered ? s.buttonStyle:''} onClick={Started}> {props.name}</button>


    );
};
